import React, {Component} from 'react'

import Logo from './Logo';
import Header from '../pages/Header'


class HeaderWrap extends Component{
    render(){
        return(
            <div style={{"border":"solid"}}>
                <p>this is the header wrap</p>
                <Logo />
                <Header />
            </div>
        )
    }
}

export default HeaderWrap;
